import moment from "moment";

import _ from 'lodash';
export default class PdfManager{
    constructor(props) {
        this.doc = props && props.doc ? props.doc : null;
        this.styles = {
            header: {
                fontSize: 11,
                bold: true,
                alignment: 'center',
                margin: [ 50, 0, 0, 0 ]
            },
            headerContacts: {
                fontSize: 9,
                bold: false,
                alignment: 'center',
                margin: [ 50, 0, 0, 0 ]

            },
            bodyheader: {
                fontSize: 14,
                bold: true,
                alignment: 'center',
                margin: [ 0, 35, 0, 0 ]
            },
            mainText: {
                fontSize: 14,
                bold: false,
                alignment: 'left',
                margin: [ 5, 10, 0, 0 ]
            }
        }
    }
    createPdf(person) {
        let imageUri =
            'data:image/png;base64,';
        let header = [
            {image: imageUri, fit: [80, 80], absolutePosition: {x: 70, y: 15}},
            { text: "НАЦІОНАЛЬНИЙ  ІНСТИТУТ  РАКУ", style: 'header' },
            { text: "УКРАЇНСЬКЕ   НАУКОВО-МЕДИЧНЕ ТОВАРИСТВО  ОНКОЛОГІВ", style: 'header' },
            { text: "Київ,  вул. Ломоносова, буд. 33/43, тел. +38 (067) 607-911-1, +38 (050) 607-911-1", style: 'headerContacts' },
        ];
        let body = [
            { text: "Висновок", style: 'bodyheader' },
            { text: person.Name ? "ПІБ: " + person.Name : "", style: 'mainText' },
            { text: person.Id ? "ID: " + person.Id : "", style: 'mainText' },
            { text: person.age ?  "Вік: " + person.age + " років": "" , style: 'mainText' },
            { text: "На основі опитування виявлено:", style: 'mainText' }
        ];
        let trueQuestions = _.cloneDeep(person.trueQuestions);
        _.each(trueQuestions, function(item, key) {
            let question = { text: key + 1 + ". " + item, style: 'mainText' };
            body.push(question);
        });

        let recomendation = [
            {text: "Рекомендація", style: 'mainText' },
            {text: "Вам рекомендовано пройти ендоскопічне обстеження шлунка та стравоходу та ультразвукове обстеження (УЗІ) черевної порожнини.", style: 'mainText' },
            {text: "Пройдіть обстеження в будь-якій установі, яка виконує такі обстеження.", style: 'mainText' },
            {text: "Після результатів обстеження, в разі, якщо підтвердиться підозра на онкологічне захворювання, Вам необхідно звернутися до Національного Інституту Раку для більш детального обстеження та уточнення діагнозу  за адресою м. Київ, вул. Ломоносова 33/34 поліклінічне відділення, кабінет № 505 пухлин шлунка та стравоходу ", style: 'mainText' },
            {text: "+38 (067) 607-911-1", style: 'mainText' },
            {text: "+38 (050) 607-911-1", style: 'mainText' },
            {text: "e-mail: oncothorax@gmail.com ", style: 'mainText' },
            {text: "http://www.oncothorax.com.ua/ ", style: 'mainText' },
            {text:moment().format("DD.MM.YYYY"), style: 'mainText'}
        ];

        var docDefinition = {
            content:[
                header,
                body,
                recomendation
            ],
            styles: this.styles

        }
        return docDefinition;
    }
}